"use strict";var Cookie={getItem:function(e){for(var t=document.cookie.split("; "),o=0;o<t.length;o++){var i=t[o].split("=");if(i[0]==e)return i[1]}},setItem:function(e,t,o){if(o){var i=new Date;i.setDate(i.getDate()+o),document.cookie=e+"="+t+";expires="+i}else document.cookie=e+"="+t},removeItem:function(e){this.setItem(e,"",-1)},getKeys:function(){for(var e=document.cookie.split("; "),t=[],o=0;o<e.length;o++){var i=e[o].split("=");t.push(i[0])}return t},clear:function(){var t=this;this.getKeys().forEach(function(e){t.setItem(e,"",-1)})}};